import React from "react";

const Footer = () => {
  return (
    <div className="py-10 px-4">
      <div>
        <h1 className="text-3xl text-[#00df91] font-bold w-full text-left">
          REACT
        </h1>
      </div>
    </div>
  );
};

export default Footer;
